// Categories
import React from 'react';
import './Categories.css';
import TextField from '@mui/material/TextField';

export default function Categories() {
  return (
    <section className="categories" id="categories">
         <br/>  <br/>  <br/>  <br/>  <br/>  <br/>

    <center> <h2>Hello,it's great to meet you</h2></center>
    <center> <p>Got a project,just fill out the below from and we will get in touch with you.<br/>
       you can also reach us at hello@orkaapps.com </p></center>
       <br/>
       <br/>
       <br/>
       <TextField
       fullWidth
        id="filled-basic" 
        label="Name"
         variant="filled"
         InputProps={{ style: { fontSize: 30 } }}
        InputLabelProps={{ style: { fontSize: 20 } }}
          />
    <TextField
       fullWidth
        id="filled-basic" 
        label="Mobile number"
         variant="filled"
         InputProps={{ style: { fontSize: 30 } }}
        InputLabelProps={{ style: { fontSize: 20 } }}
          />
           <br/>
              <TextField
       fullWidth
        id="filled-basic" 
        label="Email Address"
         variant="filled"
         InputProps={{ style: { fontSize: 30 } }}
        InputLabelProps={{ style: { fontSize: 20 } }}
          />
          <br/>
              <TextField
       fullWidth
        id="filled-basic" 
        label="Tell us more about your project"
         variant="filled"
         InputProps={{ style: { fontSize: 30 } }}
        InputLabelProps={{ style: { fontSize: 20 } }}
          />
    </section>
  );
}
